import React, {useState} from 'react';

const TodoList = ({taskList, inputText}) => {
    return (
        <div className="todo-container">
            <ul className="todo-list">
                {taskList.forEach(i=>{
                    <li>{i}</li>
                })}
            </ul>
        </div>
    )
}

export default TodoList
